import React from "react";
function Card({}) {
  return (
    <div className="card text-center p-4">
      <img className="card-img-top" src="" alt="" />
      <div className="card-body">
        <h4 className="card-title"></h4>
        <p className="card-text"></p>
      </div>
    </div>
  );
}

export default Card;
